import './App.css';
import Navbar from "./components/Navbar";
import Hero from "./components/Hero";
import Card from "./components/Card"

function App() {
  return (
    <div className="App">
        <Navbar />
        <Hero/>
        <Card
            img = "../images/star.png"
            point = {5.0}
            numebr_comments = {6}
            country = "USA"
            title = "Life Lessons with Katie Zaferes"
            price = {135}
        />
    </div>
  );
}

export default App;
